import React, {Component} from 'react';

import  express_angelic from './brand/express_angelic.png'



class Brand extends Component {
    render() {
        return (
            <div className="brand">
                   <div className="item1">
                       <img src='./brand/express_bengal_meat.png' alt=""/>
                   </div>
            </div>
        );
    }
}

export default Brand;
